function ArtistPage() {
  const location = useLocation();
  const { data } = location.state;
  console.log("!!!!!!!!!!!!!!", data.playlist["id"]);

  const {
    data: playlistData,
    error,
    isLoading,
  } = useGetAllSongsInPlaylistQuery(data.playlist["id"]);

  if (isLoading) {
    return <progress className="progress is-primary" max="100"></progress>;
  }
  // return <>Loading...</>;

  return (
    <div className="row mt-3">
      <h1>{data.playlist["name"]}</h1>
      <table className="table table-striped">
        <thead>
          <tr>
            <th>name</th>
            <th>id</th>
            <th>delete</th>
          </tr>
        </thead>
        <tbody>
          {playlistData?.songs.map((song) => {
            return (
              <tr key={song.id}>
                <td>{song.name}</td>
                <td>{song.id}</td>
                <td>
                  <DeletePlayListButton id={song.id} />
                </td>
              </tr>
            );
          })}
        </tbody>
      </table>
    </div>
  );
}

export default ArtistPage;
